import {
  faGauge,
  faServer,
  faGraduationCap,
  faEnvelope,
  faUsers,
  faCalendarCheck
} from '@fortawesome/free-solid-svg-icons';

const menuConfig = [
  {
    label: 'Dashboard',
    path: '/',
    icon: faGauge
  },
  {
    label: 'Services',
    path: '/services',
    icon: faServer
  },
  {
    label: 'Trainings',
    path: '/trainings',
    icon: faGraduationCap
  },
  {
    label: 'Bookings',
    path: '/bookings',
    icon: faCalendarCheck
  },
  {
    label: 'Contacts',
    path: '/contacts',
    icon: faEnvelope
  },
  {
    label: 'Users',
    path: '/users',
    icon: faUsers
  }
];

export default menuConfig;
